  - '@value': "This renku dataset s2s-ai-challenge contains preprocessed files used
      for training and verification of the [s2s-ai-challenge](https://s2s-ai-challenge.github.io/).\n\nContents:
      Please find a more detailed description on the [website](https://s2s-ai-challenge.github.io/#data)\n\n-
      observations  \n\_ \_- deterministic:  \n\_ \_ \_ \_- `hindcast-like-observations_2000-2019_biweekly_deterministic.zarr`
      \ \n\_ \_ \_ \_- `forecast-like-observations_2020_biweekly_deterministic.zarr`
      \ \n\_ \_- edges:  \n\_ \_ \_ \_- `hindcast-like-observations_2000-2019_biweekly_tercile-edges.nc`
      \ \n\_ \_- probabilistic:  \n\_ \_ \_ \_- `hindcast-like-observations_2000-2019_biweekly_terciled.zarr`
      \ \n\_ \_ \_ \_- `forecast-like-observations_2020_biweekly_terciled.nc`  \n-
      forecasts/hindcasts  \n\_ \_- deterministic:  \n\_ \_ \_ \_- `ecmwf_hindcast-input_2000-2019_biweekly_deterministic.zarr`
      \ \n\_ \_ \_ \_- `ecmwf_forecast-input_2020_biweekly_deterministic.zarr`  \n\_
      \_- more models could be added  \n- benchmark:  \n\_ \_- probabilistic:  \n\_
      \_ \_ \_- `ecmwf_recalibrated_benchmark_2020_biweekly_terciled.nc`\n\nNotebook
      to create this renku dataset: https://renkulab.io/gitlab/aaron.spring/s2s-ai-challenge-template/-/blob/master/notebooks/renku_datasets_biweekly.ipynb"
